import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Coment from './coment';
import {connect} from "react-redux";
import {UpdateNewMassegeBodycreator, SendMessagecreator} from '../../redux/state/DialogsData_reducer';
import {Redirect, withRouter} from "react-router-dom";
import {withAuthRedirect} from "../hoc/withAuthRedirect";
import {compose} from "redux";


let DispatchToProps = (dispatch) =>{
    return{
        UpdateNewMassegeBody: (body) =>{
            dispatch(UpdateNewMassegeBodycreator(body));
        },
        SendMessage: () =>{
            dispatch(SendMessagecreator());
        }
    }
}
let mapStateToProps = (state) => {
    return {
        DialogsData: state.DialogsData,
    }
}
let AuthReedirectComponent = withAuthRedirect(Coment);
let WithUrlDataContainerComponent = withRouter(AuthReedirectComponent);
const Comentcontainer = connect(mapStateToProps, DispatchToProps)(WithUrlDataContainerComponent);

export default Comentcontainer;
